//SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

contract FinalExcercise{
    uint a = 300;
    uint b = 12;
    uint f = 47;
    function finalize() public view returns(uint){
        uint d = 23;
        if(a>b && b<f){
         d*=d;
         return d-b;
        } else{
            return d;
        }
    } 
}

